Mongodb - Perform calculation with a just deleted value in aggregation pipeline<p>I have this document:</p>
<pre class="lang-js prettyprint-override"><code>{
  _id: ObjectId('asdu7329n'),
  payments: [
    { _id: ObjectId('28sdf310'), paidAmount: 20 },
    { _id: ObjectId('2fsd410'), paidAmount: 15 },
    { _id: ObjectId('2fs32gd70'), paidAmount: 35 },
  ],
  totalPaidAmount: 70
}
</code></pre>
<p>What I want is to re-calculate the <code>totalPaidAmount</code> field when a payment is removed, right now I'm deleting the payment in this way:</p>
<pre class="lang-js prettyprint-override"><code>const query = { _id: ObjectId(saleId) };
const update = [
  { $set: { payments: { $filter: {
    input: '$payments',
    cond: {
      $ne: [ &quot;$$this._id&quot;, ObjectId(/* paymentId to delete */) ]
    }
  }}}}
]

await salesSchema.findOneAndUpdate(query, update);

</code></pre>
<p>I know that I have to use <code>$subtract</code> possibly in a second <code>$set</code> stage but how could I reference the <code>paidAmount</code> value from the object so that I can do something like this:</p>
<pre class="lang-js prettyprint-override"><code>{
