<p>I know that I can just sum the <code>paidAmount</code> values for all the indexes of <code>payments</code> but what if there is like 1000 or more items? even if it doesn't hit the performance too much it seems to me more logical to take advantage of the <code>totalPaidAmount</code> field here.</p>

